function Contactus() {
  return (
    <div>Contact Us

      <iframe width="600" height="500" id="gmap_canvas" src="https://maps.google.com/maps?q=bintulu%20bukit%20orang&t=&z=13&ie=UTF8&iwloc=&output=embed" frameborder="0" scrolling="no" marginheight="0" marginwidth="0"></iframe>


    </div>



  )
}

export default Contactus
